import './App.css';
import React from 'react';
import { Container, Row, Col, Table, Navbar } from 'reactstrap';
import Data_table from './components/Table';
import Nav_bar from './components/Nav_bar';
import Table_View from './components/Table_View';
import Firmware_Version from './components/Firmware_Version';
import Output from './components/Output';
import DataTableExample from './components/extable';

import Test from './components/Test';
// import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
    return (
      <div>
        {
          <div>
            <Nav_bar></Nav_bar>

            <div class="container-fluid">
              <div class="row">
                <div class="col">
                  <div>
                    <Table_View></Table_View>
                  </div>
                </div>
                <div class="col">
                  <Firmware_Version></Firmware_Version>
                </div>
                <div class="col">
                  <div class="d-grid gap-2 d-md-flex justify-content-md-end">
                    <a href="http://localhost:3000/" type="button" class="btn btn-danger">
                      Refresh Page
                    </a>
                  </div>
                </div>
              </div>

              <div class="row">
                <div class="col">
                  <div>
                    <nav aria-label="breadcrumb">
                      <ol class="breadcrumb">
                        <li class="breadcrumb-item active" aria-current="page"></li>
                      </ol>
                    </nav>
                  </div>
                </div>
                <div class="col">
                  {/* Column2 Row2 */}
                </div>
              </div>
              <div class="row">
                <div class="col-7">
                  <DataTableExample></DataTableExample>
                </div>
                <div class="col-5">
                  <Output></Output>
                </div>
              </div>
            </div>
          </div>
        }
      </div>
    );
  }

export default App;
